import React, { useState, useEffect } from 'react';
import {
    Box,
    TextField,
    Button,
    Typography,
    Paper,
    List,
    ListItem,
    CircularProgress
} from '@mui/material';
import axios from '../utils/axiosConfig';
import Navbar from './Navbar';

const Chat = () => {
    const [messages, setMessages] = useState([]);
    const [input, setInput] = useState('');
    const [isLoading, setIsLoading] = useState(false);

    useEffect(() => {
        const welcomeMessage = `
Welcome to Intelligent Service! Upload your dataset and perform transformations effortlessly.

Supported Commands:
● remove column <column_name>  
  Example: remove column Age
● rename column <old_name> to <new_name>  
  Example: rename column Age to Years
● filter rows where <condition>  
  Example: filter rows where Age > 25
● columns  
  Example: columns (to list all column names)
● size  
  Example: size (to get the dataset dimensions)
        `;
        setMessages([{ sender: 'system', text: welcomeMessage }]);
    }, []);

    const handleSendMessage = async () => {
        if (!input.trim()) {
            setMessages((prev) => [
                ...prev,
                { sender: 'system', text: 'Please enter a valid command.' }
            ]);
            return;
        }

        setIsLoading(true);

        try {
            const response = await axios.post(
                '/transform',
                { command: input },
                { headers: { Authorization: `Bearer ${localStorage.getItem('token')}` } }
            );

            setMessages((prev) => [
                ...prev,
                { sender: 'user', text: input },
                { sender: 'ai', text: response.data.message }
            ]);
            setInput('');
        } catch (error) {
            const errorMessage = error.response?.data?.message || 'Failed to apply transformation';
            setMessages((prev) => [
                ...prev,
                { sender: 'user', text: input },
                { sender: 'system', text: errorMessage }
            ]);
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <>
            <Navbar />
            <Box
                sx={{
                    height: 'calc(100vh - 64px)',
                    display: 'flex',
                    flexDirection: 'column',
                    justifyContent: 'center',
                    alignItems: 'center',
                    backgroundColor: '#3E2723',
                }}
            >
                <Paper
                    elevation={6}
                    sx={{
                        width: '100%',
                        maxWidth: 800,
                        height: '80%',
                        display: 'flex',
                        flexDirection: 'column',
                        borderRadius: 2,
                        backgroundColor: '#D84315',
                        color: '#fff',
                    }}
                >
                    <Typography
                        variant="h5"
                        textAlign="center"
                        sx={{
                            padding: 2,
                            borderBottom: '1px solid #E64A19',
                            backgroundColor: '#BF360C',
                        }}
                    >
                        Chat with Intelligent Service
                    </Typography>
                    <Box sx={{ flex: 1, overflowY: 'auto', padding: 2 }}>
                        <List>
                            {messages.map((message, index) => (
                                <ListItem
                                    key={index}
                                    sx={{ justifyContent: message.sender === 'user' ? 'flex-end' : 'flex-start' }}
                                >
                                    <Paper
                                        elevation={3}
                                        sx={{
                                            padding: 1.5,
                                            maxWidth: '70%',
                                            borderRadius: '15px',
                                            backgroundColor: message.sender === 'user' ? '#FF7043' : '#F57C00',
                                            color: message.sender === 'user' ? '#fff' : '#000',
                                            whiteSpace: 'pre-wrap',
                                        }}
                                    >
                                        {message.text}
                                    </Paper>
                                </ListItem>
                            ))}
                        </List>
                    </Box>
                    <Box
                        sx={{
                            display: 'flex',
                            padding: 2,
                            backgroundColor: '#BF360C',
                            borderTop: '1px solid #E64A19',
                            alignItems: 'center',
                        }}
                    >
                        <TextField
                            placeholder="Type a command..."
                            fullWidth
                            value={input}
                            onChange={(e) => setInput(e.target.value)}
                            sx={{
                                backgroundColor: '#F57C00',
                                borderRadius: 1,
                                input: { color: '#fff' },
                            }}
                            disabled={isLoading}
                        />
                        <Button
                            variant="contained"
                            color="secondary"
                            onClick={handleSendMessage}
                            disabled={isLoading}
                            sx={{
                                marginLeft: 2,
                                textTransform: 'none',
                                backgroundColor: '#D84315',
                                '&:hover': { backgroundColor: '#BF360C' },
                            }}
                        >
                            {isLoading ? <CircularProgress size={24} color="inherit" /> : 'Send'}
                        </Button>
                    </Box>
                </Paper>
            </Box>
        </>
    );
};

export default Chat;
